import React, { Component } from 'react';
import UserLayout from "../../../hoc/userLayout";

class AddProduct extends Component {
    render() {
        return (
            <UserLayout>
                <div>
                    add product
                </div>
            </UserLayout>
        );
    }
}

export default AddProduct;
